import React from 'react'
import{BarChart,ResponsiveContainer,Bar, XAxis, YAxis, Tooltip} from 'recharts'
const array=[
  {
    name:"Male",
    value: 13,
  },
  {
    name:"FeMale",
    value: 10,
  },
   {
    name:"Other",
    value: 5,
  },
]
function Category() {
  return (
    <div className='category'>
    <h1>Category based HC</h1>
    <ResponsiveContainer width="100%" aspect={2}>
      <BarChart data={array} width={900} height={900}>
      <XAxis dataKey="name"/>
      <YAxis dataKey="value"/>
      <Tooltip col/>
        <Bar  dataKey="value" fill="orange"/>
      </BarChart>
    </ResponsiveContainer>
      
    </div>
  )
}

export default Category
